COMPONENT.script:
			initialize()=
declare
enddeclare
{
    // frame.flush() is mandatory to initialize subform correctly 
	// during initialize() block before setting attribute WebPage.
	curframe.flush ();
	FIELD(subform1).webpage = true;
	FIELD(subform1).Url(url='https://www.actian.com/openroad/', pageloadevent = 'NAVIGATIONCOMPLETE');
}

on click btnload =
{
	FIELD(subform1).Url(url=furl , pageloadevent = 'NAVIGATIONCOMPLETE');
}

on userevent 'NAVIGATIONCOMPLETE' =
{
    message 'Received Event that the Page has been Loaded. ' + HC_NEWLINE +  
		'The message object is: ' + HC_NEWLINE +  HC_NEWLINE + 
		varchar(StringObject(CurFrame.MessageObject).value) + HC_NEWLINE ;
}

row.script:
						/*
** Hard coded RGB (integer) colors, expect regular color to have been set already in BgColor via Property Inspector
*/
on mouseenter = {
    curexec.trace('hello '+ varchar(curframe.triggerfield.BgColor));

    curframe.triggerfield.BgColor = RGB(red=0, green=105, blue=217);

    // TODO is there an unRGB() - believe we have something in 4gl
    curexec.trace('hello now '+ varchar(curframe.triggerfield.BgColor));
}

on mouseexit = {
    // restore color
    curexec.trace('bye');
    curframe.triggerfield.BgColor = RGB(red=0, green=123, blue=255);
}


