COMPONENT.script:
			initialize()=
declare
	sfld = SubForm DEFAULT NULL;
	received = VARCHAR(20000) not null default  '' ;
	script = VARCHAR(2000) NOT NULL DEFAULT '';
	strHtml = stringobject;
	strUrl = stringobject;
	result = stringobject;
	ret = smallint not null;

enddeclare
{
    // frame.flush() is mandatory to initialize subform correctly 
	// during initialize() block before setting attribute WebPage.
	field(st1).curbias = FB_INVISIBLE;
	strhtml.value = 
		'<!DOCTYPE html>' + HC_NEWLINE +
		'<html>' + HC_NEWLINE +
		'<body>' + HC_NEWLINE +
		'<h3>OpenROAD WebView2 Demo</h3> ' + HC_NEWLINE +
		'<h4>URL and ExecuteScript</h4> ' + HC_NEWLINE +
		'<form id="myTargetForm">' + HC_NEWLINE +
		' <label for="ffield">Enter some data:</label><br>' + HC_NEWLINE +
		' <input type="text" id="ffield" name="ffield" value="modify me"><br>' + HC_NEWLINE +
		'</form> ' + HC_NEWLINE +
		'</body>' + HC_NEWLINE +
		'</html>'
		;
	script = 'document.getElementById("ffield").value'; 
	field(btn_loadhtml).TooltipText = 'HTML CODE = ' + HC_NEWLINE + strhtml.value;
	field(btn_execscript).TooltipText = 'Script CODE = ' + HC_NEWLINE +script;
	curframe.flush ();
	sfld = FIELD(sf);
	sfld.Webpage = TRUE;	
	if sfld.GetWebView2Version() = '' then
		CurFrame.InfoPopup(messagetext = 'Webview2 is not installed.', 
					messagetype = MT_ERROR);
	endif;	


}
on click btn_loadhtml =
{
	field(st1).curbias = FB_INVISIBLE;
	strURL.value = strhtml.value;
	sfld.URL(html=strURL, pageloadevent = 'NAVIGATIONCOMPLETE');
}
on click btn_execscript =
declare

{
	field(st1).curbias = FB_VISIBLE;
	//script='table.getData()';
	script = 'document.getElementById("ffield").value'; 
    sfld.ExecuteScript( script=script, execscriptevent='EXECCOMPLETE');
}

on userevent 'EXECCOMPLETE' =
{
	st1.ffield = StringObject(CurFrame.MessageObject).value;	
}


on userevent 'NAVIGATIONCOMPLETE' =
{
	received = StringObject(CurFrame.MessageObject).value;	
	CurFrame.StatusText = 'Loading :: ' + received + ' completed.';
}

row.script:
						on click =
{
	return;
}


